import React from 'react';
import backgroundImage from './FAM.png';

function BackgroundImage() {
  const backgroundImageStyle = {
    backgroundImage: `url(${backgroundImage})`,
    backgroundPosition: 'center',
    backgroundSize: 'contain',
    backgroundRepeat: 'no-repeat',
    width: '400px',  // Justera bredden efter önskemål
    height: '250px', // Justera höjden efter önskemål
    position: 'fixed',
    bottom: '60px',  // Justera avståndet från botten. 60px är ett exempel.
    right: '20px',   // Justera avståndet från höger sida. 20px är ett exempel.
    zIndex: 10,      // Se till att bilden hamnar ovanpå andra element om det behövs
  };

  return <div style={backgroundImageStyle}></div>;
}

export default BackgroundImage;
